import React, { useState } from 'react';
import TaskList from './components/TaskList';

// Task型をインポートまたは定義
export interface Task {
    id: number;
    title: string;
}

const App: React.FC = () => {
    const [tasks, setTasks] = useState<Task[]>([
        { id: 1, title: 'タスク1' },
        { id: 2, title: 'タスク2' },
        { id: 3, title: 'タスク3' }
    ]);

    return (
        <div>
            <h1>毎日行いたいタスク管理アプリ</h1>
            <TaskList tasks={tasks} />
        </div>
    );
};

export default App;
